import { Link } from 'react-router-dom'
import blogarticles from './articlecontent'

const Articles = () => {
    return (
        <>
            {blogarticles.map((article, key) => (
                    <Link key={key} to={`/article/${article.slug}`}>
                    <h3>{article.title}</h3>
                    <p>{article.content}</p>
                    </Link>
            ))}
        </>
            )
            }
export default Articles
